import { DISPLAY } from "./constants";
const initialState = 0;
let name_initial = "My Counter";


const changeName = (state = initialState, action) => {
  switch (action.type) {
    case DISPLAY:
      return action.name;
    default:
      return state;
  }
};

export default changeName;
